import "./App.css";
import React from "react";


function Course({courseName, courseType}) {
  return (
    <div>
      <ul>
        <li>{courseName}</li>
        <li>{courseType}</li>
      </ul>
    </div>
  )
}

function App() {

  return (
    <div className="container">
      <h1>Guvi Courses</h1>
      <Course courseName="Full Stack Development" />
    </div>
  );
}

export default App;
